/* http://meyerweb.com/eric/tools/css/reset/
   v2.0 | 20110126
   License: none (public domain)
*/
html, body, div, span, applet, object, iframe, h1, h2, h3, h4, h5, h6, p, blockquote, pre, a, abbr, acronym, address, big, cite, code, del, dfn, em, img, ins, kbd, q, s, samp, small, strike, strong, sub, sup, tt, var, b, u, i, center, dl, dt, dd, ol, ul, li, fieldset, form, label, legend, table, caption, tbody, tfoot, thead, tr, th, td, article, aside, canvas, details, embed, figure, figcaption, footer, header, hgroup, menu, nav, output, ruby, section, summary, time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline; }

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure, footer, header, hgroup, menu, nav, section {
  display: block; }

body {
  line-height: 1; }

ol, ul {
  list-style: none; }

blockquote, q {
  quotes: none; }

blockquote:before, blockquote:after {
  content: '';
  content: none; }

q:before, q:after {
  content: '';
  content: none; }

table {
  border-collapse: collapse;
  border-spacing: 0; }

.header {
  text-align: center;
  padding: 6rem 0;
  background: #927EEC; }
  .header-title {
    font-size: 2.4rem; }
    @media (min-width: 600px) {
      .header-title {
        font-size: 3rem; } }
  .header-subTitle {
    font-size: 1.8rem; }
    @media (min-width: 600px) {
      .header-subTitle {
        font-size: 3rem; } }

.container {
  width: 400px;
  height: 400px;
  margin: 100px 25px;
  display: grid;
  position: absolute;
  left: 46%;
  transform: translate(-50%, 0);
  grid-template-columns: repeat(2, 1fr);
  grid-template-rows: repeat(2, 1fr);
  grid-gap: 7px;
  grid-template-areas: "img1 img2" "img3 textImg"; }

.img1 {
  grid-area: img1;
  background: url("https://www.bluevolt.fr/wp-content/uploads/2017/05/Longboard-Bluevolt-Boards-Shark-4.jpg") no-repeat center;
  background-size: cover; }

.img2 {
  grid-area: img2;
  background: url("https://www.vagueetvent.com/blog/wp-content/uploads/2017/05/kQ8M9Z.jpg") no-repeat center;
  background-size: cover; }

.img3 {
  grid-area: img3;
  background: url("https://lh3.googleusercontent.com/vVFgVzGniu6kIb4ExGO0k96LCoiaLHjPWeLFFeMPgQ1Glhkvip8VyU6ISCkZVhoyhg=h900") no-repeat center;
  background-size: cover; }

.text {
  grid-area: textImg;
  display: flex;
  flex-direction: column;
  justify-content: center;
  font-family: helvetica; }
  .text_title {
    font-weight: bold;
    margin-bottom: 10px;
    font-size: 14px; }
  .text_text {
    margin-bottom: 10px;
    width: 90%;
    font-size: 12px; }
  .text_link {
    margin-bottom: 10px;
    width: 90%;
    font-size: 12px;
    text-decoration: none;
    color: #28b0ff; }

@media (min-width: 600px) {
  .container {
    width: 575px;
    grid-template-columns: repeat(3, 1fr);
    grid-template-rows: 100px auto auto 75px;
    grid-template-areas: ". img2 img2" "img1 img2 img2" "img1 img3 textImg" ". img3 textImg"; } }
